import React from "react";
import { Link } from "react-router-dom";
import { useSelector } from "react-redux";

import { selectCurrentUser } from "../../redux/user/selectors";

import "./styles.scss";

const ProfilePage = () => {
  const currentUser = useSelector(selectCurrentUser);

  return (
    <div className="user-profile-page">
      <div className="user-info">
        Display name:
        <span className="display-name">{currentUser.displayName}</span>
      </div>
      <div className="user-info">
        Email:
        <span className="email">{currentUser.email}</span>
      </div>
      <div className="user-info">
        Total score of previous games:
        <span className="total-score">{currentUser.totalScore}</span>
      </div>
      <hr className="area" />
      <Link to="/">
        <button className="button-return">Вернуться на главную страницу</button>
      </Link>
    </div>
  );
};

export default ProfilePage;
